window.bookSummaryJSON = "<p>If you've never read <i>The 21 Irrefutable Laws of Leadership,</i> you've been missing out on one of the best-selling leadership books of all time. If you have read the original version, then you'll love this new expanded and updated one. </p> <p>Internationally recognized leadership expert, speaker, and author John C. Maxwell has taken this million-seller and made it even better:</p> <ul> <li>Every Law of Leadership has been sharpened and updated</li> <li>Seventeen new leadership stories are included</li> <li>Two new Laws of Leadership are introduced</li> <li>New evaluation tool will reveal your leadership strengths - and weaknesses</li> <li>New application exercises in every chapter will help you grow</li> </ul> <p>Why would Dr. Maxwell make changes to his best-selling book?</p> <p>\"A book is a conversation between the author and reader,\" says Maxwell. \"It's been 10 years since I wrote <i>The 21 Laws of Leadership.</i> I've grown a lot since then. I've taught these laws in dozens of countries around the world. This new edition gives me the opportunity to share what I've learned.\"</p>"; 
